import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';






const columns = [
    { id: 'officer', label: 'Officer Name' },
    { id: 'branch', label: 'Branch'},
    {
      id: 'email',
      label: 'Email',
      align: 'right',
    },
    {
      id: 'phone',
      label: 'Telephone Number',
      align: 'right'
    },
    {
      id: 'bus',
      label: 'Assigned Bus',
      align: 'right'
    },
    {
        id: 'status',
        label: 'Status',
        align: 'right'
      },
      {
        id: 'action',
        label: '',
        align: 'right'
      },

  ];

  function createData(officer, branch, email, phone, bus, status, action) {
    // const density = population / size;
    return { officer, branch, email, phone, bus, status, action };
  }




const Drivers = () => {


  return (
    <section>


<TableContainer component={Paper}>
      <Table sx={{ minWidth: 650 }} size="small" aria-label="Drivers Table">
        <TableHead>
          <TableRow>
          {columns.map((column) => (
                <TableCell >
                  {column.label}
                </TableCell>
              ))}
          </TableRow>
        </TableHead>
        <TableBody>
            <TableRow>
                        <TableCell> 
                            <div className="d-flex alc f-10">
                                <Avatar />
                                Ahmed Peter
                            </div>
                        </TableCell>
                        <TableCell> Abuja  <br/>[Garki]</TableCell>
                        <TableCell> talk2ahmedpeter@gmail.com</TableCell>
                        <TableCell> 0803 000 0000</TableCell>
                        <TableCell> Toyota Hiace</TableCell>
                        <TableCell> Active</TableCell>
                        <TableCell> <MoreVertIcon/> </TableCell>
            </TableRow>
            <TableRow>
                        <TableCell> 
                        <div className="d-flex alc f-10">
                                <Avatar />
                                Philip Yahaya
                            </div>
                        </TableCell>
                        <TableCell> Abuja  <br/>[Garki]</TableCell>
                        <TableCell> fakemail@outlook.com</TableCell>
                        <TableCell> 0803 000 0000</TableCell>
                        <TableCell> Toyota Hiace</TableCell>
                        <TableCell> Active</TableCell>
                        <TableCell> <MoreVertIcon/> </TableCell>
            </TableRow>
        </TableBody>
      </Table>
    </TableContainer>





    </section>
  );
};

export default Drivers;
